rmente, por meio de doaes ou compras.O acervo da Hemeroteca conta com aproximadamente 350 ttulos de jornais e revistas da segunda metade do sculo XIX at os dias atuais. O jornal literrio Ostensor Brasileiro  o exemplar mais antigo, de 1845. O incio da guarda foi realizado pelo prprio Alfredo, que possua o costume de destacar, em lpis vermelho, os assuntos de seu interesse. H indcios de organizao original de alguns maos sobre eventos considerados importantes da Histria Nacional, como a Proclamao da Repblica, a morte de D. Pedro II, o Centenrio da Independncia e dentre outros.','1','1','Inaugurado em 27 de junho de 1939, o arquivo histrico rene documentos provenientes da coleo particular da famlia Lage e da doao de personalidades, assim como documentos administrativos do Museu. O carter ecltico do colecionismo de Alfredo exerce igual influncia nos critrios de aquisio e preservao das fontes escritas. Esta coleo foi incrementada por compras em leiles no Brasil e no exterior e  formada por cerca de 15.000 documentos.A coleo inclui autgrafos de personalidades do sculo XIX, cartas dos imperadores brasileiros, desenhos e dedicatrias. O documento mais antigo do Arquivo Histrico  do sculo XVI, escrito em alemo gtico em pergaminho e assinado por Carlos V.Atualmente, o Arquivo Histrico est dividido em duas partes. Na seo Arquivos, encontram-se os documentos referentes ao arquivo institucional do Museu Mariano Procpio, assim como os arquivos particulares de Arthur Arcuri e Henrique Jos Hargreaves, respectivamente, ex-diretor do Museu e ex-presidente do Conselho de Amigos.Na seo Colees, h duas subcategorias: Colees de documentos avulsos e Colees particulares. A primeira  composta por documentos de diferentes tipos, como: administrativos referentes ao municpio de Juiz de Fora, documentos estrangeiros, mapas brasileiros e estrangeiros, cartes de visitas, autgrafos e poesia. Alm destes, h documentos institucionais e empresariais, como os da Escola de Msica Francisco Braga, da Companhia Pantaleone Arcuri, da Sociedade Cultura Artstica de Juiz de Fora, de Carrio Filmes e da Litografia Biancovilli.A subcategoria Colees Particulares  formada por diferentes doaes e aquisies, nas quais se destacam os documentos das famlias Imperial e Ferreira Lage.As correspondncias pessoais entre Princesa Isabel e D. Maria Amlia Lage testemunham laos de amizade e cumplicidade. A coleo sobre a nobreza brasileira  extensa, abrangendo nomes como Duque de Caxias, Conde da Mota Maia, Conde de Prados, Visconde e Viscondessa de Cavalcanti, Jos Bonifcio de Andrada e Silva, Baro e Baronesa de So Joaquim e Marquesa de Santos.Arquivo Fotogrfico, formado por cerca de 18000 itens, dentre daguerretipos, ferrtipos, cartes postais, cartas de visita, lbuns e fotografias da Famlia Imperial, da corte e da cidade de Juiz de Fora. O arquivo fotogrfico permite desvendar prticas de auto-representao da elite do sculo XIX, assim como a evoluo da tcnica e linguagem fotogrficas.A coleo sobre a Famlia Imperial  extensa e possui vrias preciosidades, como a ltima fotografia tirada em solo brasileiro e a imagem do cadver de D. Pedro II na Frana. As fotografias revelam as faces dos principais personagens da famlia, como: D. Pedro II e D.Teresa Cristina, Princesa Isabel e Princesa Leopoldina.O rico acervo sobre Juiz de Fora  composto por panormicas, cartes postais e fotografias com temticas urbanas, retratando, sobretudo, a imagem da modernizao.As obras pblicas possuem grande destaque, devido as inovaes tcnicas e as Instituies de renome. H ainda diversas fotografias de personalidades da poca, como Alan Kardec, a atriz francesa Sarah Bernhard, os escritores Victor Hugo e Alexandre Dumas, rainha Vitria, Garibaldi e Anita e dentre outros.',943),(991,3109430,-43.369238,-21.773489,2,'MG',3136702,'Juiz de Fora','Museu de Arqueologia e Etnologia Americana da Universidade Federal de Juiz de Fora','Faculdade de Engenharia - Campus Universitrio','36036-330',' ','CAMPUS UNIVERSITARIO',' ',' ',' ','MARTELOS',