 Fundao de Integrao, Desenvolvimento e Educao do Noroeste do Estado  FIDENE, desde a instalao da FAFI, em 1957, a constituio da FIDENE em 1969, o reconhecimento da UNIJUI em 1985, a regionalizao desta, em 1993. 2. Arquivo IJU - Preserva a documentao referente s atividades dos diversos setores do municpio de Iju. A organizao/classificao  por assunto e o arranjo da mesma, pelo rgo responsvel pela produo. Mantm as colees: Eduardo Jaunsem; Famlia Beck; Pio Jos Busanello; e Martin Fischer. 3. Arquivo Cooperativismo Preserva documentos relacionados a 108 cooperativas localizadas no Estado do Rio Grande do Sul. 4. Arquivo Regional - Arquiva documentos de 282 municpios gachos. 5. Arquivo Sindicalismo - Preserva a documentao relacionada a 73 entidades sindicais ou associaes de classe. 6. Arquivo Kaingang/Guarani e Xet - Documentao relacionada aos grupos indgenas mencionados no ttulo, com destaque para o Guarani e Kaingang do Sul. Hemeroteca - Objetiva preservar os jornais produzidos em Iju; os de cunho histrico e poltico e, outros, com temticas relacionadas a ndios e patrimnio histrico-cultural. Vinte e quatro (24) ttulos esto disponveis sendo que o Correio Serrano- 1917 a 1988- e Die Serra Post - 1919 a 1984 dos primeiros editados em Iju, encontram-se digitalizados/micro filmados, com acesso atravs de banco de dados especfico. A Diviso Imagem e Som - Armazena documentos em outros suportes fsicos como fotografias, negativos flexveis e em vidro, discos, fitas cassete, fitas VHS, filmes e DVDs. A organizao das imagens obedece aos mesmos critrios da Diviso de Documentao, diferindo na constituio das colees e, no nmero de arquivos. Compe o arquivo fotogrfico o da FIDENE, Iju (com as colees famlia Beck; Eduardo Jaunsem; Germano Gieseler; Bandeira; Jornal da Manh), Cooperativismo, Sindicalismo. Regional, Indgena, Nacional, Internacional.',2564),(2006,4325710,-53.914189,-28.387874,1,'RS',4310207,'Iju','Museu Escolar do Colgio Evanglico Augusto Pestana','Rua Floriano Peixoto, 132','9